    direction: -1,
  });

  const defaultOptions = {
    loop: false,
    autoplay: false,
    rendererSettings: {
      preserveAspectRatio: 'xMidYMid slice'
    }
  };

  return (
    <div className="App">
      A
      <Lottie
        options={defaultOptions}
        width={400}
        height={400}
        direction={animationState.direction}
